import React, { Component } from 'react'

class Cities extends Component {
    render() {
        const { cities } = this.props;
        const cityList = cities.map(city => {

            return (
                <div className="city" key={city._id}>
                    <li>{city.name}</li>
                </div>
            )

        })

        return (
            <div className="city-list">
                {cityList}
            </div>
        )

    }
}

export default Cities;
